<!doctype html>
<html lang="en" xmlns="http://www.w3.org/1999/html">
<head>
    <meta charset="UTF-8">
    <meta name="viewport"
          content="width=device-width, user-scalable=no, initial-scale=1.0, maximum-scale=1.0, minimum-scale=1.0">
    <meta http-equiv="X-UA-Compatible" content="ie=edge">
    <title>{{ quiz.title }}</title>
    <style>
        @import url('https://fonts.googleapis.com/css2?family=Baloo+Bhaijaan+2:wght@400..800&family=Lato:ital,wght@0,100;0,300;0,400;0,700;0,900;1,100;1,300;1,400;1,700;1,900&display=swap');
        @import url('https://fonts.googleapis.com/css2?family=Baloo+Bhaijaan+2:wght@400..800&family=Lato:ital,wght@0,100;0,300;0,400;0,700;0,900;1,100;1,300;1,400;1,700;1,900&family=Poppins:ital,wght@0,100;0,200;0,300;0,400;0,500;0,600;0,700;0,800;0,900;1,100;1,200;1,300;1,400;1,500;1,600;1,700;1,800;1,900&display=swap');

        body{
            font-family: 'Poppins', sans-serif;
            font-size: 16px;
            padding: 0px;
            width: 100%;
            margin: 0px;
            display: flex;
            flex-direction: column;
            overflow-x: hidden;
        }

        .main{
            width: 100%;
            flex-grow: 1;
            display: flex;
            flex-direction: column;
            margin: 0px;
            overflow-y: auto;
            overflow-x: hidden;
            padding-top: 50px;
            padding-bottom: 80px;
        }

        .quiz_title{
            display: flex;
            flex-direction: column;
            align-items: flex-start;
            margin-left: 10px;
            margin-right: 20px;
        }

        h1{
            font-family: 'Baloo Bhaijaan 2', sans-serif;
            font-size: 32px;
            font-weight: 700;
            font-style: normal;
            margin: 10px 0px 0px -50px;
        }

        h3{
            font-family: 'Baloo Bhaijaan 2', sans-serif;
            font-size: 20px;
            font-weight: 700;
            line-height: 120%;
            margin: 0px;
        }

        h4{
            margin: 0px;
        }

        p{
            margin: 0px;
        }

        .back_pannel {
            position: fixed;
            top: 0;
            left: 0;
            width: -webkit-fill-available;
            z-index: 100;
            display: flex;
            justify-content: space-between;
            height: 24px;
            padding-top: 30px;
            padding-left: 20px;
            padding-right: 20px;
            background-color: white;
        }

        .header{
            width: 90%;
            display: flex;
            justify-content: space-between;
            align-content: center;
            margin-left: 23px;
            margin-top: -15px;
        }

        .activity_name{
            display: flex;
            flex-direction: row;
            align-items: center;
        }

        .points{
            height: fit-content;
            display: flex;
            align-content: center;
        }

        .svg_container{
            display: flex;
            flex-direction: column;
            align-items: center;
            justify-content: center;
            margin-top: 20px;
        }

        .instructions{
            margin: 20px;
        }

        .get_started{
            font-family: 'Poppins', sans-serif;
            font-size: 14px;
            width: 300px;
            height: 50px;
            border: none;
            border-radius: 92px;
            background-color: #66B498;
            color: white;
            margin: 40px auto;
        }

        a {
            text-decoration: none;
            outline: none;
            margin: auto;
        }

        a:focus, a:active {
            outline: none;
            box-shadow: none;
        }

        .nav_pannel {
            position: fixed;
            bottom: 0;
            left: 0;
            width: 90%;
            z-index: 100;
            display: flex;
            justify-content: space-between;
            padding: 15px 20px 30px 20px;
            background-color: white;
        }
    </style>
</head>
